(168012, 'E7906D7C-ED17-491A-AF84-91FE86681D74', 'A note for you to think about...I stole this from a favorite book I want to share with you: The first element of true love is loving kindness. The essence of loving kindness is being able to offer happiness. You can be the sunshine for another person. You can’t offer happiness until you have it for yourself. So build a home inside by accepting yourself and learning to love and heal yourself. Learn how to practice mindfulness in such a way that you can create moments of happiness and joy for your own nourishment. Then you have something to offer the other person.', '468481368000000000', '468481777000000000', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'None', 'David', '2015-11-05T21:42:48'),
(167981, 'BBAB3693-4AC7-4B51-A364-CE1E41C6D49E', 'So based on this quote, how much do you think you have your own happiness so that you can be sunshine for another person?', '468506893000000000', '468507581000000000', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'None', 'nitzan.pelman@gmail.com', '2015-11-06T04:48:13'),
