(167504, '0FEE21F9-C8F4-400D-8C88-4B7889D70FDB', 'One of the things that I love about you...and I''m not sure I like this word....is that I simply feel enriched by almost all of our interactions. You have me consider things from different angles. while I don''t always agree, I just value so much having you as my mirror. That and your playful warmth pulls the same out of me...and dampens my sometimes more somber, negative impulses. We might schedule play time...but I feel pretty much all time is playtime.  I miss you, but am not sad...just look forward to you coming back! ', '469237708000000000', '469240551000000000', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'None', 'David', '2015-11-14T15:48:28'),
